update print_layout set template = ''
                    where id = 'ACCOUNT_BOOK_DETAIL';
--##
update print_layout set template = ''
                    where id = 'ACCOUNT_BOOK_GROUP';
--##
update print_layout set template = ''
                    where id = 'INVENTORY_BOOK_DETAIL';
--##
with a as (select id,type, template from print_layout where id = 'ACCOUNT_BOOK_DETAIL')
update print_template set template=a.template from a where layout=a.id and is_default;
--##
with a as (select id,type, template from print_layout where id = 'ACCOUNT_BOOK_GROUP')
update print_template set template=a.template from a where layout=a.id and is_default;
--##
with a as (select id,type, template from print_layout where id = 'INVENTORY_BOOK_DETAIL')
update print_template set template=a.template from a where layout=a.id and is_default;
--##
